import { Row, Col, Avatar } from 'antd';
import './AboutMe.css'
import ProfileImage from './profile-image.jpeg'

const AboutMe = () => {
  return (
    <Row type="flex" justify="space-around" >
        <div className="avatar-container">
           <Avatar src={ProfileImage} size={300} />
        </div>
        <div className="biography-container">
          <h2>About Me</h2>
          I am currently an undergraduate student 
          at <a href="https://www.usc.edu/" target="_blank" rel="noopener noreferrer">University of Southern California</a>, 
          pursuing a bachelor degree in <a href="https://www.cs.usc.edu/" target="_blank" rel="noopener noreferrer">Computer Science</a>, 
          and a minor in <a href="https://itp.usc.edu/academics/applied-analytics/" target="_blank" rel="noopener noreferrer">Applied Analytics</a>. 
          My fields of interest are video game development, data engineering, and web technology.
        </div>
    </Row>
  );
};

export default AboutMe;
